import { Container, Row } from 'react-bootstrap';

class Loign extends React.Component {
    constructor(props) {
        super(props);
    };
    render() {
        return (
            <Container>
                <Row>
                    <Image src="https://colorlib.com/etc/lf/Login_v18/images/bg-01.jpg"></Image>
                </Row>
            </Container>
        )
    }
}
